import React from "react";

const NameField = ({ handleChange, values, errors }) => {
  return (
    <div>
      <label htmlFor="name">Ім'я:</label>
      <input
        type="text"
        id="name"
        name="name"
        value={values.name}
        onChange={handleChange}
      />
      {errors.name && <p>{errors.name}</p>}
    </div>
  );
};

export default NameField;
